import React from "react";
import { useRef } from "react";
import { NavLink } from "react-router-dom";
import star from '../img/star.png'

const ArchiveJournalEntry = (props) => {    
    const ChipStyles = useRef({
        position: 'absolute',
        top: Math.floor(Math.random()*200),
        left: Math.floor(Math.random()*1200),
    });
    return (
        <div className="archived-entries-container">
            <img className="archived-entries-star" 
            src={star}
            style={ChipStyles.current}
            ></img>
        </div>
    )
}

export default ArchiveJournalEntry
